import React from "react";
import "./intro.css";
import Me from "../../image/1630784845657.jpeg";

const Intro = () => {
  return (
    <div className="i">
      <div className="i-left">
        <div className="i-left-wrapper">
          <h2 className="i-intro">Hello, My name is</h2>
          <h1 className="i-name">Karmugil Kalaiyarasan Kavitha</h1>
          <div className="i-title">
            <div className="i-title-wrapper">
              <div className="i-title-item">Full-Stack Developer</div>
              <div className="i-title-item">Web Developer</div>
              <div className="i-title-item">Blockchain Developer</div>
              <div className="i-title-item">Software Test Engineer</div>
            </div>
          </div>
          <div className="i-desc">
            I develop Full-Stack responsive websites that includes designing the
            Databases and communicating with the DB using custom build APIs from
            scratch.
          </div>
        </div>
      </div>
      <div className="i-right">
        <div className="i-bg"></div>
        <img src={Me} alt="My Profile Picture" className="i-img" />
      </div>
    </div>
  );
};

export default Intro;
